The M10 is a traditional AK design, but has six unique and/or custom features that set it apart from the pack:

    Front sight is integrated with gas block;
    Rear sight includes RPK style windage adjustment;
    Features factory installed UTG Picatinny handguard rail;
    M+M Chaos billet flash hider / muzzle brake;
    Factory side rail mount;
    Tapco G-2 trigger and retaining plate;
    Hogue pistol grip.

This is a wonderful rifle, but I am downsizing a bit. Rifle has seen only seen 4 mags run through it. Iron sights are on, Hogue grip is extremely comfortable, quad rail is a nice feature for any Magpul furniture/optics/or light accessories. I borrowed the above from a great review about the M&M M10-762, at http://www.thetruthaboutguns.com/2013/10/joe-grine/gun-review-mm-m10-762-rifle/ (these guys do great work and is well worth checking out). This review is what sold me on the rifle. Mags fit perfectly, the upgrades are simple add-ons but add to the completeness of this rifle and the CNC machine work from the American importer - M&M out of Colorado - is really well done. I will toss in a nice, steel sight post tool made by Magna-Matic.

One thing this AK has over others is the Phoenix KickLite stock, which absorbs a significant amount of felt recoil. 
(http://www.mcssl.com/store/8791249/catalog/product/b1d56ea6d4084cfc8a8341d20065487e)

